  return (

    <View style ={{padding :80 ,flexDirection :'column' ,justifyContent:'center' , alignContent :'center'}} >


      <View style={{ flexDirection :'row' , justifyContent:'center' }}>
      <TextInput placeholder="nom admin" style ={{width: 200 ,padding :5, }} />
      </View>
      <View style={{ flexDirection :'row' , justifyContent:'center' }}>
      <TextInput placeholder="mot de pass" style ={{width: 200,padding : 5}}  />
      </View>

       <View  style ={{padding: 0  , flexDirection : 'row' , justifyContent :'center'}} >
      <Button title="se connecter avec facebook" />
      </View>
      <View style ={{padding: 10 , flexDirection : 'row' , justifyContent : 'center' , width :1250}} >
      <Button title="se connecter avec email "/>
      </View>

    </View>
  );
}
